import React from 'react';
import {Link} from "react-router-dom";

function Navbar() {
    return (
        <nav className="navbar">
            <h1>The Studio Management App</h1>
            <div className="links">
                <Link to={'/userLogin'}>SIGN IN</Link>
                <Link to={'/userRegis'}>REGISTER</Link>
                <Link to={'/inquiry'} style={{
                    color: 'white',
                    backgroundColor: '#f1356d',
                    borderRadius: '8px'
                }}>INQUIRY</Link>
            </div>
        </nav>

    );
}

export default Navbar;
